import React from "react";

import "./Button.css";

interface ButtonProps {
  children: React.ReactNode;
  styles: string;
  type?: string;
  onClick: () => void;
}

const Button: React.FC<ButtonProps> = function ({ styles, onClick, type }) {
  return (

      <button
        className={styles}
        type={(type = null || "submit")}
        onClick={onClick}
      ></button>
  );
};

export default Button;
